import Navbar from "./components/Navbar/Navbar";
import Home from "./components/Home";
import { Route } from "react-router-dom";

function App() {
  return (
    <div>
      <Route path="/mainPage">
        <Navbar />
        <Home />
      </Route>
    </div>
  );
}

export default App;
